import React, { Component } from "react";
// Importando os components necessários da lib react-materialize
import { Row, Table} from 'react-materialize';

//const Tbl = () => (
class Tbl extends Component {  

  state = {
    investments: []
  }

  componentDidMount() {
    fetch('http://localhost:5000/api/details')
    .then(res => res.json())
    .then((data) => {
      this.setState({ contacts: data })
    })
    .catch(console.log)
  }

  render (){
    return (
      <Row>
        <Table className="highlight centered">
            <thead>
              <tr>
                  <th>Data</th>
                  <th>Valor</th>
                  <th>Excluir</th>
              </tr>
            </thead>

            <tbody>
              <tr >
                <td>05/06/2020</td>
                <td>R$ 1.500,00</td>
                <td><a href="/">X</a></td>
              </tr>
            </tbody>
        </Table>
      </Row>
    );
  }
}
//)
export default Tbl;
